import React,{Button} from 'react';

const Book = (props) => {
    const {_id,Name,Author,Description,Price,Image} = props.book;
  return (
    <div>
        <img src={Image} alt={Name}/>
        <article>
            By {Author}
        </article>
        <h3>{Name}</h3>
        <p>{Description}</p>
        <h2>Rs.{Price}</h2>
        <Button>Update</Button>
        <Button>Delete</Button>
    </div>
  )
};

export default Book;
